import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for at least one product price to appear using a unique selector
    // Try to find by .product-price inside .product-card (grid view)
    await page.waitForSelector('.product-card .product-price', { timeout: 5000 });

    // Take screenshot of the featured products grid
    const gridShot = path.join(screenshotsDir, 'step_2_products_grid.png');
    const productsGrid = await page.$('#productsGrid');
    if (productsGrid) {
      await productsGrid.screenshot({ path: gridShot });
      screenshots.push(gridShot);
    }

    // Extract all visible product prices from both featured and Jun's products
    // Use multiple strategies: .product-price, also try XPath for robustness
    const prices = [];

    // Strategy 1: All .product-price elements inside .product-card
    const priceHandles = await page.$$('.product-card .product-price');
    for (const handle of priceHandles) {
      const text = await handle.textContent();
      if (text) {
        // Extract all $ amounts from the text (handles both price and original price)
        const matches = text.match(/\$\d[\d,]*\.?\d{0,2}/g);
        if (matches) {
          matches.forEach(price => prices.push(price));
        }
      }
    }

    // Strategy 2: XPath for any element containing a $ and inside a product card
    const xpathHandles = await page.$$('xpath=//div[contains(@class,"product-card")]//*[contains(text(),"$")]');
    for (const handle of xpathHandles) {
      const text = await handle.textContent();
      if (text) {
        const matches = text.match(/\$\d[\d,]*\.?\d{0,2}/g);
        if (matches) {
          matches.forEach(price => prices.push(price));
        }
      }
    }

    // Remove duplicates and sort
    const uniquePrices = Array.from(new Set(prices)).sort((a, b) => {
      // Sort numerically
      const numA = parseFloat(a.replace(/[^0-9.]/g, ''));
      const numB = parseFloat(b.replace(/[^0-9.]/g, ''));
      return numA - numB;
    });

    // Screenshot of Jun's products grid for completeness
    const junGrid = await page.$('#junProductsGrid');
    if (junGrid) {
      const junShot = path.join(screenshotsDir, 'step_3_jun_products_grid.png');
      await junGrid.screenshot({ path: junShot });
      screenshots.push(junShot);
    }

    return {
      success: true,
      action: "Extracted all visible product prices from the page using multiple selector strategies.",
      extractedData: {
        productPrices: uniquePrices
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
